import React, { Component } from 'react';

import '../index.css';
import './App.css';

import PageIcon from '../components/page-icon';

class App extends Component {
  constructor() {
    super()
    this.state = {
      page: 'Introduction',
      isWaiting: true
    }
  }

  // componentDidMount() {
    
  // }

  render() {
    if (this.state.isWaiting === true) {
      setTimeout(() => this.setState({ isWaiting: false }), 1000)
      return <button> </button>
    }
    else return <div>

      <div className = "svg-container"> 
        <svg viewBox="0 0 500 500">
          <path d = "M100,500 C150,200 350,0 500,150 L500,00 L0,0 Z" fill = 'rgb(50, 153, 71)'> </path>
        </svg>
      </div>

      <div className = 'avatar'> </div>

      <div className = 'navigation'> 
        <PageIcon imageURL='./home-icon.png' pageName = 'Home'/>
        <PageIcon imageURL='./expertise-icon.png' pageName = 'Expertise'/>
        <PageIcon imageURL='./project-icon.png' pageName = 'Project'/>
        <PageIcon imageURL='./contact-icon.png' pageName = 'Contact'/>
      </div>

      {
        // switch case for page
      }

    </div>
  }
}

export default App;
